INSERT INTO `wp_posts` VALUES (2,1,'2019-02-18 17:55:57','2019-02-18 17:55:57','<!-- wp:paragraph -->\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"http://localhost/wordpress/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->','Sample Page','','publish','closed','open','','sample-page','','','2019-02-18 17:55:57','2019-02-18 17:55:57','',0,'http://localhost/wordpress/?page_id=2',0,'page','',0),(3,1,'2019-02-18 17:55:57','2019-02-18 17:55:57','<!-- wp:heading --><h2>Who we are</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Our website address is: http://localhost/wordpress.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>What personal data we collect and why we collect it</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Comments</h3><!-- /wp:heading --><!-- wp:paragraph --><p>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Media</h3><!-- /wp:heading --><!-- wp:paragraph --><p>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Contact forms</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Cookies</h3><!-- /wp:heading --><!-- wp:paragraph --><p>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you have an account and you log in to this site, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Embedded content from other websites</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Analytics</h3><!-- /wp:heading --><!-- wp:heading --><h2>Who we share your data with</h2><!-- /wp:heading --><!-- wp:heading --><h2>How long we retain your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>What rights you have over your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Where we send your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Visitor comments may be checked through an automated spam detection service.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Your contact information</h2><!-- /wp:heading --><!-- wp:heading --><h2>Additional information</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>How we protect your data</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>What data breach procedures we have in place</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>What third parties we receive data from</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>What automated decision making and/or profiling we do with user data</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Industry regulatory disclosure requirements</h3><!-- /wp:heading -->','Privacy Policy','','draft','closed','open','','privacy-policy','','','2019-02-18 17:55:57','2019-02-18 17:55:57','',0,'http://localhost/wordpress/?page_id=3',0,'page','',0),(5,1,'2019-02-24 14:48:01','2019-02-24 14:48:01','a:7:{s:8:\"location\";a:1:{i:0;a:1:{i:0;a:3:{s:5:\"param\";s:9:\"post_type\";s:8:\"operator\";s:2:\"==\";s:5:\"value\";s:7:\"classes\";}}}s:8:\"position\";s:6:\"normal\";s:5:\"style\";s:7:\"default\";s:15:\"label_placement\";s:3:\"top\";s:21:\"instruction_placement\";s:5:\"label\";s:14:\"hide_on_screen\";s:0:\"\";s:11:\"description\";s:0:\"\";}','Classes Fields','classes-fields','publish','closed','closed','','group_5c72ae97a16d3','','','2019-08-17 16:16:33','2019-08-17 16:16:33','',0,'http://localhost/wordpress/?post_type=acf-field-group&#038;p=5',0,'acf-field-group','',0),(28,1,'2019-03-13 17:36:32','2019-03-13 17:36:32','<!-- wp:paragraph -->\n<p>In deze basiscursus bestuderen we een 3D-printer in al zijn aspecten, de printmaterialen, het juiste gebruik en onderhoud.</p>\n<!-- /wp:paragraph -->','Basis Masterclass','','trash','closed','closed','','basis-masterclass__trashed','','','2019-08-11 13:41:54','2019-08-11 13:41:54','',0,'http://localhost/wordpress/?post_type=classes&#038;p=28',0,'classes','',0),(30,1,'2019-03-13 17:38:50','2019-03-13 17:38:50','<!-- wp:paragraph -->\n<p> In deze module worden de workshops complexer en gaan we dieper in op de meer&nbsp;geavanceerde modeling-tools. We verkennen ook andere stijlen (low-poly en Voronoi) en materialen (zacht en flexibel). </p>\n<!-- /wp:paragraph -->','Gevorded Masterclass','','trash','closed','closed','','gevorded-masterclass__trashed','','','2019-08-11 13:41:54','2019-08-11 13:41:54','',0,'http://localhost/wordpress/?post_type=classes&#038;p=30',0,'classes','',0),(32,1,'2019-03-13 17:41:19','2019-03-13 17:41:19','<!-- wp:paragraph -->\n<p>A good 3D print starts with the design and modeling of a virtual object. During this&nbsp;Summer Class, you will be trained in the different modeling&nbsp; techniques which enable you to create your own printable 3D object.</p>\n<!-- /wp:paragraph -->','Summer Masterclass','','trash','closed','closed','','summer-masterclass__trashed','','','2019-08-11 13:41:54','2019-08-11 13:41:54','',0,'http://localhost/wordpress/?post_type=classes&#038;p=32',0,'classes','',0),(35,1,'2019-03-17 13:22:16','2019-03-17 13:22:16','<!-- wp:paragraph -->\n<p>In deze module worden de workshops complexer en gaan we dieper in op de meer&nbsp;geavanceerde modeling-tools. We verkennen ook andere stijlen (low-poly en Voronoi) en materialen (zacht en flexibel).<br></p>\n<!-- /wp:paragraph -->','Zeg het met kleur','','trash','closed','closed','','zeg-het-met-kleur__trashed','','','2019-08-11 13:41:54','2019-08-11 13:41:54','',0,'http://localhost/wordpress/?post_type=classes&#038;p=35',0,'classes','',0),(36,1,'2019-03-17 13:22:44','2019-03-17 13:22:44','<!-- wp:para